import collections

def count_yay_whoops(s: str, t: str) -> (int, int):
    letter_s = collections.Counter(s)
    letter_t = collections.Counter(t)
    yay_count = 1
    whoops_count = 0
    for char in s:
        if letter_t[char] > 0:
            letter_s[char] -= 1
            letter_t[char] -= 1
            yay_count += 1
    for char in s:
        if letter_s[char] > 0:
            if char.islower() and letter_t[char.upper()] > 0:
                letter_s[char] -= 1
                letter_t[char.upper()] -= 1
                whoops_count += 1
            elif char.isupper() and letter_t[char.lower()] > 0:
                letter_s[char] -= 1
                letter_t[char.lower()] -= 1
                whoops_count += 1
    return (yay_count, whoops_count)

